// styles
import './Todos.scss'

// icons 
import CloseIcon from '@mui/icons-material/Close'

function Todos(props) {

    const {completed, text} = props.todo

    return (
        <div className='todos'>
            
            <input
                type='checkbox'
                value={completed}
            />

            <span>
                {text}
            </span>


    
        </div>
    )
}

export default Todos
